import React from 'react';

const Profile = () => {
  return (
    <div className="page-container">
      <h1>Hồ sơ cá nhân</h1>
      <p>Trang này sẽ hiển thị thông tin hồ sơ người dùng.</p>
    </div>
  );
};

export default Profile;
